import React, { Component } from 'react';
import { connect } from "react-redux";
import HomeHeader from '../../HomePage/HomeHeader';
import './Booking.scss'
import HomeFooter from '../../HomePage/Section/HomeFooter';
class Booking extends Component {

    constructor(props) {
        super(props);
        this.state = {
            detailDoctor: {}
        }
    }

    async componentDidMount() {
    }
    render() {
        return (
            <>
                <HomeHeader
                    isShowBanner={false} 
                />
                <div className='booking-container'>
                    <div className='row booking-intro'>
                        <span className='booking-intro-item'>
                            Xác nhận thông tin đặt lịch
                        </span>
                        <div className='border'></div>
                    </div>
                    <div className='row'>
                        <div className='col-3 booking-left-overlay'>
                            <div className='booking-info-doctor'>
                                <div className='booking-info-doctor-avt'></div>
                                <div className='booking-info-doctor-desc'>
                                    <div className='booking-info-doctor-desc-name'>
                                        <span>BS. Nguyen Tho Lo</span>
                                        <p> Chuyên khoa thần kinh</p>
                                    </div>
                                </div>
                            </div>
                            <div className='booking-info-booking'>
                                <div className='booking-info-booking-time'>
                                    <p>Ngày 9-3-2022</p>
                                    <span>8:00AM - 10:00AM</span>
                                </div>
                                <div className='booking-info-booking-price'>
                                    <span>500.000 VND</span>
                                </div>                                
                            </div>                                
                        </div>
                        <div className='col-9 patient-container'>
                            <div className='patient-container-header'><b>THÔNG TIN BỆNH NHÂN</b></div>
                            <div className='row patient-container-booking'>
                                <div className='col-8 patient-container-booking-info'>
                                    <p><b>Tên bệnh nhân</b>: Nguyễn Thế Vinh</p>
                                    <p><b>Email</b>: Vinh@gmail.com</p>
                                    <p><b>Giới tính</b> bê đê</p>
                                    <p><b>Địa chỉ</b>:12 </p>
                                    <p><b>Số điện thoại</b>: Nguyễn Thế Vinh</p>
                                </div>
                                <div className='col-4 patient-container-booking-img'></div>
                            </div>
                            <div className='patient-container-header'><b>THÔNG TIN KHÁM BỆNH</b></div>
                            <div className='row patient-container-information'>
                                <b>Lịch tái khám</b>
                                <table border='1'>
                                    <tr>
                                        <td>Mã khám bệnh</td>
                                        <td>Ngày khám bệnh</td>
                                        <td>Bác sĩ</td>
                                        <td>Mô tả</td>
                                    </tr>
                                </table>
                            </div>
                            <div className='row patient-container-information'>
                                <b>Lịch sử khám</b>
                                <table border='1'>
                                    <tr>
                                        <td>Mã lich kham</td>
                                        <td>Ngày khám bệnh</td>
                                        <td>Bác sĩ</td>
                                        <td>Mô tả</td> 
                                    </tr>
                                </table>
                            </div>
                            <div className='booking-button'>
                                <button className='btn-ok'>Dat lich</button>
                                <button className='btn-cancel'>Huy bo</button>

                            </div>
                        </div>
                      </div>
                </div>
                <HomeFooter />
            </>
        );
    }
}

const mapStateToProps = state => {
    return {
    };
};

const mapDispatchToProps = dispatch => {
    return {
    };
};

export default connect(mapStateToProps, mapDispatchToProps)(Booking);
